                <label>Sort by<span>&nbsp;</span>
                    <select onChange={this.onChangeSort}>
                        <option value="test1">Testcity</option>
                        <option value="test2">Test2</option>
                    </select>
                </label>

            </div>
        )
    }
}

export default AddComment
